// src/App.js
import React from 'react';
import MusicPlayerCard from './components/MusicPlayerCard';
import SongInfoCard from './components/SongInfoCard';
import TermOfTheWeekCard from './components/TermOfTheWeekCard';
import ArtistSpotlightCard from './components/ArtistSpotlightCard';
import MusicChallengeCard from './components/MusicChallengeCard';
import './App.css';

const App = () => {
  return (
    <div className="dashboard">
      <div className="main-card">
        <MusicPlayerCard />
      </div>
      <div className="side-cards">
        <SongInfoCard />
        <TermOfTheWeekCard />
        <ArtistSpotlightCard />
        <MusicChallengeCard />
      </div>
    </div>
  );
};

export default App;
